Communicating between two browser tabs can be achieved through several methods. Here are a few approaches:

### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple, but it has limitations, such as data size limits and the fact that data is not updated in real-time.

**Example:**
```javascript
// Tab 1
